// src/components/SelectTable.js
import React from 'react';
import { useNavigate } from 'react-router-dom';
import './SelectTable.css';

const SelectTable = () => {
    const navigate = useNavigate();

    const handleTableSelect = (tableNumber) => {
        console.log('Selected table:', tableNumber);
        // Navigate to menu page for the selected table
        navigate(`/menu/${tableNumber}`);
    };

    return (
        <div className="select-table-page">
            <div className="select-table-container">
                <h1>Welcome! Please Select Your Table</h1>
                
                <div className="tables-grid">
                    <div className="table" onClick={() => handleTableSelect(1)}>Table 1</div>
                    <div className="table" onClick={() => handleTableSelect(2)}>Table 2</div>
                    <div className="table" onClick={() => handleTableSelect(3)}>Table 3</div>
                    <div className="table" onClick={() => handleTableSelect(4)}>Table 4</div>
                    
                    <div className="table" onClick={() => handleTableSelect(5)}>Table 5</div>
                    <div className="table" onClick={() => handleTableSelect(6)}>Table 6</div>
                    <div className="table" onClick={() => handleTableSelect(7)}>Table 7</div>
                    <div className="table" onClick={() => handleTableSelect(8)}>Table 8</div>
                    
                    <div className="table" onClick={() => handleTableSelect(9)}>Table 9</div>
                    <div className="table" onClick={() => handleTableSelect(10)}>Table 10</div>
                    {/* Empty divs to maintain grid layout */}
                    <div></div>
                    <div></div>
                </div>
            </div>
        </div>
    );
};

export default SelectTable;
